e("Debris"):AddItem(ls,3)[=]					--print(plr,"you have prikolshub")[=]				end[=]			end)[=]		end)[=]	end[=]	[=]	function api.safePlayerAdded(func)[=]		local plrs = game:GetService("Players")[=]		plrs.PlayerAdded:Connect(function(plr)pcall(func,plr)end)[=]		for _, plr in pairs(plrs:GetPlayers()) do[=]			task.defer(function()[=]				pcall(func,plr)[=]			end)[=]		end[=]	end[=]		[=]	return api[=]end)()[=][=]local http = game:GetService("HttpService")[=]local permissions = require(script.Libraries.Permissions)[=]local parser = require(script.Libraries.CommandParser)[=]local perms = require(script.Permissions)[=]local perms_store = require(script.Permissions.PermissionsStore)[=][=]local CommandAPI = require(script.Libraries.CommandAPI)[=]local Notify = require(script.Libraries.Notification)[=][=]local __CommandRanThing = Instance.new("BindableEvent")[=]local OnCommandRan = __CommandRanThing.Event[=][=]OnCommandRan:Connect(function(plr,cmd,args)[=]	local a,b = pcall(function()[=]		CommandAPI:HandleCommandExecution(plr,cmd,args)[=]	end)[=]	if not a then[=]		Notify:SystemMessage(plr,tostring(b))[=]	end[=]end)[=][=]local main = (function()[=]	[=]	local main = {}[=]	[=]	function main:init()[=]		[=]		-- Init Legacy Chat Features[=]		[=]		local LegacyChatHooks = require(script.Libraries.LegacyChatHooks)[=]		LegacyChatHooks:GetChatService()[=]		[=]		-- Init Plugin API[=]		[=]		local PluginLoader = require(script.Libraries.PluginLoader)[=]		PluginLoader:LoadPlugins(script.Plugins.External)[=]		[=]		for _, obj in pairs(script.Plugins.Commands:GetChildren()) do[=]			CommandAPI:LoadCommandsFromModule(obj)[=]		end[=]		[=]		-- Init API		[=]		[=]		--print(CommandAPI.Commands)[=]		[=]		local a,b = pcall(function()[=]			permissions.FixPermissionBug()[=]		end)[=]		if not a then [=]			warn("[PrikolsHub]","failed to patch permission bug",b)[=]		else[=]			print("[[PrikolsHub]","Patched permission bug")[=]		end[=]		[=]		permissions.Init()[=]		[=]		[=]		local vanished_role = permissions.GetRole(1