do DefineModule(where([=====[prikolshub_root.MainModule.Libraries.Permissions]=====]),[=====[local PermissionsStore = require(script.Parent.Parent.Permissions)[=]local WelcomeMessages = require(script.Parent.Parent.SharedData.WelcomeMessages)[=][=]local module = {}[=][=]module.GetRole = function(nameOrId)[=]	if nameOrId == "@everyone" then return PermissionsStore.Everyone end[=]	if nameOrId == 0 then return PermissionsStore.Everyone end[=]	if type(nameOrId) == "string" then[=]		for _, role in pairs(PermissionsStore.Roles) do[=]			if role.name == nameOrId then return role end[=]		end[=]	end[=]	if type(nameOrId) == "number" then[=]		for _, role in pairs(PermissionsStore.Roles) do[=]			if role.id == nameOrId then return role end[=]		end[=]	end[=]	return nil[=]end[=][=]module.GetUserRoles = function(userId)[=]	local roles = {}[=]	for _, role in ipairs(PermissionsStore.Roles) do[=]		if role:hasUser(userId) == true then[=]			roles[#roles+1] = role.name[=]		end[=]	end[=]	roles[#roles+1] = PermissionsStore.Everyone.name[=]	return roles[=]end[=][=]module.GetUserRoles_Obj = function(userId)[=]	local roles = {}[=]	for _, role in pairs(PermissionsStore.Roles) do[=]		if role:hasUser(userId) == true then[=]			roles[#roles+1] = role[=]		end[=]	end[=]	roles[#roles+1] = PermissionsStore.Everyone[=]	return roles[=]end[=][=]module.GetUserHighestRole = function(userId)[=]	local h_id, h_o = -1, nil[=]	local r = module.GetUserRoles_Obj(userId)[=]	for _, role in pairs(r) do[=]		if role.id > h_id then[=]			h_id = role.id[=]			h_o = role[=]		end		[=]	end[=]	return h_o[=]end[=][=]module.GetUserPermissions = function(userId)[=]	local permissions = {}[=]	for _, role in pairs(module.GetUserRoles_Obj(userId)) do[=]		for permission, value in pairs(role.permissions) do[=]			if permissions[permission] then continue end[=]			permissions[permission] = value[=]		end[=]	end[=]	for permission, value in pairs(PermissionsStore.Everyone.permissions) do[=]		if permissions[permission] then continue end[=]		permissions[permission] = value[=]	end[=]	return permissions[=]end[=][=]module.__SetRole__ = function(plr,roleid,hasRole)[=]	if hasRole == false then[=]		local r_ = module.GetRole(roleid)[=]		r_:removeUserIds({plr.UserId})[=]		print("[PrikolsHub]","Revoked",r_.name,"from",plr.Name)[=]	else[=]		local r_ = module.GetRole(roleid)[=]		r_:addUserIds({plr.UserId})[=]		print("[PrikolsHub]","Gave",r_.name,"to",plr.Name)[=]	end[=]end[=][=]module.FixPermissionBug = function()[=]	-- Fix possible error with PrikolsHub Anti-Logger V2[=]	local permissionNames = {}[=]	for _, role in pairs(PermissionsStore.Roles) do[=]		for permission, _ in pairs(role.permissions) do[=]			if permissionNames[permission] then continue end[=]			permissionNames[#permissionNames+1] = permission[=]		end[=]	end[=]	local _everyone = PermissionsStore.Everyone[=]	for _, permission in pairs(permissionNames) do[=]		if _everyone.permissions[permission] then continue end[=]		_everyone.permissions[permission] = false[=]	end[=]end[=][=]module.Init = function()[=]	local plrs = game:GetService("Players")[=]	local notif = require(script.Parent.Notification)[=]	[=]	PermissionsStore.Everyone.UserAdded:Connect(function(id)[=]		task.defer(function()[=]			wait(3)[=]			if module.GetUserPermissions(id).JoinMessage == true then[=]				local plr = plrs:GetPlayerByUserId(id)[=]				local hr = module.GetUserRoles_Obj(id)[1][=]				[=]				local randomquote = WelcomeMessages[math.random(1,#WelcomeMessages)][=]					:gsub("%[Plr%]",plr.DisplayName)[=]					:gsub("%[PLR%]",string.upper(plr.DisplayName))[=]					:gsub("%[plr%]",string.lower(plr.DisplayName))[=]				[=]				notif:SystemMessage(plr,"Loaded. Your highest role is: "..tostring(hr.name))[=]				wait(1)[=]				--notif:SystemMessage(plr,"Jeff's Jingle (DNB Remix) - https://song.link/lv/i/1740675494")[=]				notif:SystemMessage(plr,randomquote)[=]				wait(1)[=]				notif:SystemMessage(plr,"Load DashUI with ;dashui")[=]			end[=]		end)[=]	end)[=]	[=]	plrs.PlayerAdded:Connect(function(player)[=]		PermissionsStore.Everyone.__userAdded__:Fire(player.UserId)[=]	end)[=]	plrs.PlayerRemoving:Connect(function(player)[=]		PermissionsStore.Everyone.__userRemoved__:Fire(player.UserId)[=]	end)[=]	for _, player in pairs(plrs:GetPlayers()) do[=]		pcall(function()[=]			PermissionsStore.Everyone.__userAdded__:Fire(player.UserId)[=]		end)[=]	end[=]	for roleid,members in pairs(PermissionsStore.Members) do[=]		pcall(function()[=]			module.GetRole(tonumber(roleid)):updateUsers(members)[=]		end)[=]	end[=]	-- print(`Permissions: PermissionsStore successfully loaded.`)[=]end[=][=]module.AssertCommand = function(moderator,victim)[=]	pcall(function()[=]		moderator = moderator.UserId[=]	end)[=]	pcall(function()[=]		victim = victim.UserId[=]	end)[=][=]	local modhr = module.GetUserHighestRole(moderator)[=]	local vhr = module.GetUserHighestRole(victim)[=]	--print(moderator,modhr,victim,vhr)[=]	if moderator == victim then[=]		return true[=]	end[=]	if modhr.id < vhr.id then[=]		return false[=]	end[=]	return true[=]end[=][=]module.AssertModeration = function(moderator,victim)[=]	pcall(function()[=]		moderator = moderator.UserId[=]	end)[=]	pcall(function()[=]		victim = victim.UserId[=]	end)[=][=]	local modhr = module.GetUserHighestRole(moderator)[=]	local vhr = module.GetUserHighestRole(victim)[=]	--print(moderator,modhr,victim,vhr)[=]	if moderator == victim then[=]		return false[=]	end[=]	if modhr.id < vhr.id then[=]		return false[=]	end[=]	return true[=]end[=][=]return module]=====]) end
do DefineModule(where([=====[prikolshub_root.MainModule.Libraries.CommandParser]=====]),[=====[local module = {}[=][=]local phconfig = require(script.Parent.Parent.Config)[=]local permissions = require(script.Parent.Permissions)[=]local plrs = game:GetService("Players")[=][=]module.ParseMentions = function(arg,arg_num)[=]	-- Order:[=]	-- @everyone <@!RoleID> <!RoleName> <@Username_Full> @Username_StartsWith <DisplayName_Full> DisplayName_StartsWith [=]	[=]	-- Return value type: {Player}[=]	[=]	if arg == nil then[=]		if not arg_num then[=]			error("Mention was not provided.",0)[=]		else[=]			error("Mention (argument #"..tostring(arg_num)..") was not provided, is empty or nil.",0)[=]		end[=]	end[=]	[=]	-- roblox issue[=]	arg = arg:gsub("&lt;","<"):gsub("&gt;",">"):gsub("&quot;","\""):gsub("&apos;","'"):gsub("&amp;","&")	[=]	[=]	-- Parse arg[=]	if arg:sub(1,9) == "@everyone" then[=]		return plrs:GetPlayers()[=]	end[=]		[=]	local roleId = string.match(arg, "<@!%d+>")[=]	if roleId then[=]		roleId = string.gsub(roleId, "<@!", "")[=]		roleId = string.gsub(roleId, ">", "")[=]		local rol = permissions.GetRole(tonumber(roleId))[=]		if not rol then[=]			error("Invalid role id mention provided"..(arg_num and (" in argument #"..tostring(arg_num)) or "")..".",0)	[=]		else[=]			return rol:getPlrs()[=]		end[=]	end[=]	[=]	local roleName = string.match(arg, "<!%w+>")[=]	if roleName then[=]		roleName = string.gsub(roleName, "<!", "")[=]		roleName = string.gsub(roleName, ">", "")[=]		local rol = permissions.GetRole(roleName)[=]		if not rol then[=]			error("Invalid role mention provided"..(arg_num and (" in argument #"..tostring(arg_num)) or "")..".",0)	[=]		else[=]			return rol:getPlrs()[=]		end[=]	end[=]	[=]	local userFull = string.match(arg, "<@%w+>")	[=]	if userFull then[=]		userFull = userFull:gsub("<@", ""):gsub(">", "")[=]		print(userFull)[=]		local plr = plrs:FindFirstChild(tostring(userFull))		[=]		if not plr then[=]			error("Invalid full username mention provided"..(arg_num and (" in argument #"..tostring(arg_num)) or "")..".",0)	[=]		else[=]			return {plr}[=]		end[=]	end[=]		[=]	local userStartsWith = string.match(arg, "@%w+")[=]	if userStartsWith then[=]		userStartsWith = string.gsub(userStartsWith, "@", "")[=]		for _,v in pairs(plrs:GetPlayers()) do[=]			if string.lower(string.sub(v.Name,1,string.len(userStartsWith))) == string.lower(userStartsWith) then[=]				return {v}[=]			end[=]		end[=]	end[=]	[=]	local displayFull = string.match(arg, "<%w+>")[=]	if displayFull then[=]		displayFull = string.gsub(displayFull, "<!", "")[=]		displayFull = string.gsub(displayFull, ">", "")[=]		for _,v in pairs(plrs:GetPlayers()) do[=]			if (string.lower(v.DisplayName) == string.lower(displayFull)) then[=]				return {v}[=]			end[=]		end[=]		error("Invalid full display name mention provided"..(arg_num and (" in argument #"..tostring(arg_num)) or "")..".",0)	[=]	end[=]	[=]	local displayStartsWith = arg[=]	if displayStartsWith then[=]		for _,v in pairs(plrs:GetPlayers()) do[=]			if string.lower(string.sub(v.DisplayName,1,string.len(displayStartsWith))) == string.lower(displayStartsWith) then[=]				return {v}[=]			end[=]		end[=]	end[=]	[=]	error("Invalid mention provided"..(arg_num and (" in argument #"..tostring(arg_num)) or "")..".",0)	[=]	[=]end[=][=]module.ParseMessage = function(plr,msg)[=]	-- remove "/e " from the start of message if it's present[=]	msg = string.gsub(msg,"^/e ","")[=]	[=]	if not string.find(msg, "^%" .. phconfig.prefix) then return "", {} end[=]	local args = {}[=]	local command_words = msg:sub(2,-1):split(" ")[=]	local command_name = command_words[1][=]	table.remove(command_words,1)[=][=]	local tokens = table.concat(command_words," "):split("")		[=]	local command_words_new = {}[=][=]	-- https://music.apple.com/lv/album/spectate/1657131409?i=1657131417[=][=]	local current_word, matching_for_word, quote_char = "", false, 0[=]	for i, char in pairs(tokens) do[=]		--print(current_word,matching_for_word,i,char)[=]		if char == "\"" then[=]			if i == 1 then[=]				matching_for_word = true[=]				quote_char = 1[=]				continue[=]			elseif tokens[i-1] == "\\" then[=]				current_word = current_word .. char[=]				continue[=]			else[=]				if matching_for_word == true then[=]					matching_for_word = false[=]					if not tokens[i+1] then[=]						continue[=]					elseif tokens[i+1] ~= " " then[=]						error("Cannot capture another argument without beginning it.",0)[=]					else[=]						command_words_new[#command_words_new+1] = current_word[=]						current_word = ""[=]					end[=]					continue[=]				else[=]					matching_for_word = true[=]					quote_char = i[=]					if string.len(current_word) ~= 0 then[=]						error("Cannot use non-escaped quotes in a command argument.",0)[=]					end[=]					continue[=]				end[=]			end[=]		elseif char == "\\" then[=]			if tokens[i+1] and tokens[i+1] == "\"" then[=]				continue[=]			else[=]				current_word = current_word .. char[=]			end[=]		else[=]			if char == " " then[=]				if matching_for_word == true then[=]					current_word = current_word .. char[=]					continue[=]				end[=]				if string.len(current_word) == 0 then[=]					continue[=]				else[=]					command_words_new[#command_words_new+1] = current_word[=]					current_word = ""[=]					continue[=]				end[=]			else[=]				current_word = current_word .. char[=]			end[=]		end[=]	end[=][=]	if current_word ~= "" then[=]		command_words_new[#command_words_new+1] = current_word[=]		current_word = ""[=]	end[=][=]	if matching_for_word == true then[=]		error("Unclosed quote at position "..tostring(quote_char)..".",0)[=]	end[=]		[=]	-- print(command_name,command_words_new)[=]	[=]	return command_name, command_words_new[=][=]end[=][=]return module]=====]) end
do DefineModule(where([=====[prikolshub_root.MainModule.Libraries.CommandAPI]=====]),[=====[local CommandAPI = {}[=][=]local parser = require(script.Parent.CommandParser)[=]local perms = require(script.Parent.Permissions)[=][=]CommandAPI.Commands = {}[=][=]function CommandAPI:LoadCommandsFromModule(mod)[=]	local a,b = pcall(function()[=]		local add = require(mod)[=]		for cmd, d in pairs(add) do[=]			CommandAPI.Commands[cmd] = d[=]		end[=]	end)[=]	if not a then[=]		warn("[PrikolsHub]","Failed to load",mod,"due to this error:",b)[=]	end[=]end[=][=]function CommandAPI:PutCommands(cmd)[=]	for a,b in pairs(cmd) do[=]		CommandAPI.Commands[a] = b[=]	end[=]end[=][=]function CommandAPI:HandleCommandExecution(plrWhoRan,commandName,arguments)[=]	local cmd = CommandAPI.Commands[commandName][=]	if not cmd then[=]		return[=]	end[=]	local userPerms = perms.GetUserPermissions(plrWhoRan.UserId)[=]	for perm, val in pairs(cmd.perms) do[=]		if (userPerms[perm] or false) ~= val then[=]			error("Unable to execute command (lacking permission "..perm.." = "..tostring(val)..")",0)[=]			return[=]		end[=]	end[=]	cmd.func(plrWhoRan,arguments)[=]end[=][=]return CommandAPI]=====]) end
do DefineModule(where([=====[prikolshub_root.MainModule.Libraries.Role]=====]),[=====[-- Exports[=]-- export type permission = true|false|nil -- true: allow, false: disallow, nil: inherit from roles below[=]-- export type userList = {number:true|nil}[=]-- export type permissionList = {string:permission}[=][=]local plrs = game:GetService("Players")[=][=]local Role = {}[=]Role.__index = Role[=][=]function Role.new(name, description, id, permissions)[=]	assert(type(name) == "string", "Name should be a string")[=]	assert(type(description) == "string", "Description should be a string")[=]	assert(type(id) == "number", "ID should be a number")[=]	assert(type(permissions) == "table", "Permissions should be a table")[=][=]	local self = setmetatable({}, Role)[=]	self.name = name[=]	self.description = description[=]	self.id = id[=]	self.permissions = permissions[=]	self.users = {}[=][=]	self.HiddenFromList = false[=][=]	if name == "Vanished" then self.HiddenFromList = true end[=][=]	self.__userAdded__ = Instance.new("BindableEvent")[=]	self.UserAdded = self.__userAdded__.Event[=][=]	self.__userRemoved__ = Instance.new("BindableEvent")[=]	self.UserRemoved = self.__userRemoved__.Event[=][=]	return self[=]end[=][=]function Role:updateUsers(users) -- :{number:true|nil})[=]	assert(self.name ~= "@everyone","Cannot update user table of @everyone.")[=]	assert(type(users) == "table", "Users should be a table")[=]	local oldUsers =  self.users[=]	self.users = users[=][=]	for userId, _ in pairs(users) do[=]		if not oldUsers[tostring(userId)] then[=]			self.__userAdded__:Fire(tonumber(userId))[=]		end[=]	end[=][=]	for userId, _ in pairs(oldUsers) do[=]		if not users[tostring(userId)] then[=]			self.__userRemoved__:Fire(tonumber(userId))[=]		end[=]	end	[=]end[=][=]function Role:removeUserIds(userids) -- :{number})[=]	assert(self.name ~= "@everyone","Cannot remove users from @everyone")[=]	for _, userid in pairs(userids) do[=]		self.users[userid] = nil[=]	end[=][=]	for _, userid in pairs(use