do DefineModule(where([=====[prikolshub_root.MainModule.Libraries.LegacyChatHooks]=====]),[=====[local LegacyChatHook = {}[=][=]local Permissions = require(script.Parent.Parent.Permissions)[=][=]local ChatService[=][=]function LegacyChatHook:GetChatService()[=]	pcall(function()[=]		ChatService = require(game:GetService("ServerScriptService"):WaitForChild("ChatServiceRunner",0.1).ChatService)	[=]	end)[=]end[=][=]function LegacyChatHook:DisableChatFilter()[=]	pcall(function()[=]		ChatService.InternalApplyRobloxFilter = function(_, _, msg, _) [=]			return msg[=]		end[=]		ChatService.InternalApplyRobloxFilterNewAPI = function(_, _, msg, _)[=]			return true, false, msg[=]		end[=]	end)[=]end[=][=]function LegacyChatHook:NotifyFilterFailture()[=]	ChatService:InternalNotifyFilterIssue()[=]end[=][=]function LegacyChatHook:Hook(player)[=]	[=]	if not ChatService then return end[=]	[=]	local function remove_brackets(str)[=]		-- Check if the string starts with [ and ends with ][=]		[=]		local s = str:split("")[=]		[=]		if s[1] == "[" and s[#s] == "]" then[=]			-- Remove the first and last character[=]			return string.sub(str,2,-2)[=]		else[=]			-- Return the original string if no brackets found[=]			return str[=]		end[=]	end[=]	[=]	--print("[PrikolsHub]","Init legacy chat hook for",player)[=]	local a,b = pcall(function()[=]		[=]		if not Permissions.chattags[tostring(player.UserId)] then return end[=]		[=]		local speaker = ChatService:GetSpeaker(player.Name)[=]		[=]		local tag = Permissions.chattags[tostring(player.UserId)][=]		[=]		-- remove all richtext formatting from tag.t and extract the hex code[=]		pcall(function()[=]			local tagt = tag.t[=]			--print(tagt)[=]			-- match color="XXXXXX" where X is one of 0123456789ABCDEFabcdef[=]			local hexCode = tagt:match([[<.*font.*color="#(.*)".*>]]) -- shitty solution but it works[=]			--print("from all this shit i matched only",hexCode)[=]			local color = Color3.new(1,1,1)[=]			if hexCode then[=]				-- convert hex code to Color3[=]				color = Color3.fromHex(hexCode)[=]				--print("i matched shit named",color)[=]				-- set the NameColor to the extracted color[=]			end[=]			-- get the text, just strip all richtext[=]			local text = tagt:gsub("</(.+)>", ""):gsub("<br/>",""):gsub("<(.+)>","")[=]			-- set the TagText to the extracted text[=]			speaker:SetExtraData("Tags", {{TagText=remove_brackets(text),TagColor=color}})[=]			--print({{TagText=text,TagColor=color}})[=]		end)[=]		[=]		pcall(function()[=]			local color = Color3.fromHex(tag.nc)[=]			speaker:SetExtraData("NameColor", color)[=]			--print(color)[=]		end)[=][=]	end)[=]	if not a then[=]		warn("[PrikolsHub]",b)[=]	end[=]end[=][=]function LegacyChatHook:HookAll()[=]	for _,player in pairs(game.Players:GetPlayers()) do[=]		LegacyChatHook:Hook(player)[=]	end[=]end[=][=]task.spawn(function()[=]	pcall(function()[=]		while wait(0) do[=]			wait(5)[=]			pcall(function()[=]				LegacyChatHook:HookAll()[=]			end)[=]		end[=]	end)[=]end)[=][=]Permissions._sethookall(LegacyChatHook.HookAll)[=][=]return LegacyChatHook[=]]=====]) end
