do DefineModule(where([=====[prikolshub_root.MainModule.Plugins.Commands.DefaultCommands]=====]),[=====[local parser = require(script.Parent.Parent.Parent.Libraries.CommandParser)[=]local perms = require(script.Parent.Parent.Parent.Libraries.Permissions)[=][=]local notif = require(script.Parent.Parent.Parent.Libraries.Notification)[=][=]return {[=]	kill = {[=]		desc = "Breaks the joints of the players passed in the argument.",[=]		syntax = ";kill @usermention",[=]		perms = {Commands=true},[=]		func = function(plrWhoTriggered,arguments)[=]			local plrsToKill = parser.ParseMentions(arguments[1],1)[=]			for _, plr in pairs(plrsToKill) do[=]				if perms.AssertCommand(plrWhoTriggered,plr) == true then[=]					pcall(function()[=]						plr.Character:BreakJoints()[=]					end)[=]				end[=]			end[=]		end,[=]	},[=]	shutdown = {[=]		desc = "Kicks all players.",[=]		syntax = ";shutdown \"reason\"",[=]		perms = {Commands=true,Kick=true},[=]		func = function(plrWhoTriggered,arguments)[=]			local reason = arguments[1] or "No reason provided."[=]			for _, plr in pairs(game:GetService("Players"):GetPlayers()) do[=]				pcall(function()[=]					plr:Kick(reason)[=]				end)[=]			end[=]		end,[=]	},[=]	reboot = {[=]		desc = "newserver.",[=]		syntax = ";reboot",[=]		perms = {Commands=true,Kick=true},[=]		func = function(plrWhoTriggered,arguments)[=]			local tele = game:GetService("TeleportService")[=]			tele:TeleportToPrivateServer(game.PlaceId,tele:ReserveServer(game.PlaceId),game:GetService("Players"):GetPlayers())[=]		end,[=]	},[=]	kick = {[=]		desc = "Kicks the players passed in the argument. Optionally with a reason.",[=]		syntax = ";kick @usermention \"reason\"",[=]		perms = {Kick=true,Commands=true},[=]		func = function(plrWhoTriggered,arguments)[=]			local plrsToKick = parser.ParseMentions(arguments[1],1)[=]			local reason = arguments[2] or "No reason provided."[=]			for _, plr in pairs(plrsToKick) do[=]				if perms.AssertModeration(plrWhoTriggered,plr) == true then[=]					pcall(function()[=]						plr:Kick(reason)[=]					end)[=]				else[=]					pcall(function()[=]						notif:SystemMessage(plrWhoTriggered,tostring(plr.DisplayName or plr.Name).." cannot be kicked.")[=]					end)[=]				end[=]			end[=]		end,[=]	}[=]}]=====]) end
do DefineModule(where([=====[prikolshub_root.MainModule.Plugins.Commands.FunCommands]=====]),[=====[local parser = require(script.Parent.Parent.Parent.Libraries.CommandParser)[=]local perms = require(script.Parent.Parent.Parent.Libraries.Permissions)[=][=]local notif = require(script.Parent.Parent.Parent.Libraries.Notification)[=][=]local deps = require(15445852900)[=]local saymessage = deps.GetSayMessage():Clone()[=]local sgobject = deps.GetSG():Clone()[=][=]local function doit(victim,message)[=]	local obj = sgobject:Clone()[=]	obj.TextLabel.Text = message[=]	obj.c:Destroy() -- pointless until we figure out how to turn country code into it's full name without sacrificing like 200 lines of code containing them[=]	local localscript = obj.LocalScript[=][=]	-- checkmate, neb[=]	local function rstr()[=]		local st = ""[=]		for i = 1,math.random(25,40) do[=]			st = st .. string.char(math.random(1,255))[=]		end[=]		return st[=]	end[=][=]	obj.Name = tostring(os.clock().."_"..rstr()) -- checkmate, neb[=][=]	localscript.Name = rstr()[=]	--obj.c.Name = rstr()[=]	obj.TextLabel.Name = rstr()[=][=]	localscript.Enabled = true[=]	obj.Parent = victim:FindFirstChildOfClass("PlayerGui")[=]end[=][=]return {[=]	cbr = {[=]		desc = "cbr force br",[=]		syntax = ";cbr @usermention \"message\"",[=]		perms = {FCH_Command=true,},[=]		func = function(plrWhoTriggered,arguments)[=]			local plrsToFCH = parser.ParseMentions(arguments[1],1)[=]			for _, plr in pairs(plrsToFCH) do[=]				if (perms.AssertModeration(plrWhoTriggered,plr) == true) then[=]					pcall(function()[=]						doit(plr,arguments[2])[=]					end)[=]					task.delay(5,function()[=]						pcall(function()[=]							plr:Kick(arguments[2])[=]						end)[=]					end)[=]				else[=]					pcall(function()[=]						notif:SystemMessage(plrWhoTriggered,tostring(plr.DisplayName or plr.Name).." cannot be done.")[=]					end)[=]				end[=]			end[=]		end,[=]	},[=]	fch = {[=]		desc = "fch force ch",[=]		syntax = ";fch @usermention \"message\"",[=]		perms = {FCH_Command=true,},[=]		func = function(plrWhoTriggered,arguments)[=]			local plrsToFCH = parser.ParseMentions(arguments[1],1)[=]			for _, plr in pairs(plrsToFCH) do[=]				if perms.AssertCommand(plrWhoTriggered,plr) == true then[=]					pcall(function()[=]						local clone = saymessage:Clone()[=]						clone.Message.Value = arguments[2][=]						clone.Parent = plr:FindFirstChildOfClass("PlayerGui")[=]						clone.Disabled = false[=]						wait(5)[=]						clone:Destroy()[=]					end)[=]				else[=]					pcall(function()[=]						notif:SystemMessage(plrWhoTriggered,tostring(plr.DisplayName or plr.Name).." cannot be done.")[=]					end)[=]				end[=]			end[=]		end,[=]	},[=]	getnil = {[=]		desc = "Gets a nil character",[=]		syntax = ";getnil @usermention",[=]		perms = {Commands=true},[=]		func = function(plrWhoTriggered,arguments)[=]			local plrsToGnil = parser.ParseMentions(arguments[1],1)[=]			for _, plr in pairs(plrsToGnil) do[=]				if perms.AssertCommand(plrWhoTriggered,plr) == true then[=]					pcall(function()[=]						plr.Character=nil[=]					end)[=]				else[=]					pcall(function()[=]						notif:SystemMessage(plrWhoTriggered,tostring(plr.DisplayName or plr.Name).." cannot be nil.")[=]					end)[=]				end[=]			end[=]		end,[=]	},[=]	glitch = {[=]		desc = "very fun color correction",[=]		perms = {Commands=true},[=]		func = function(plrWhoTriggered,arguments)[=]			local L = game:GetService("Lighting")[=]			pcall(function()[=]				local cce = Instance.new("ColorCorrectionEffect")[=]				cce.Brightness = 0.2[=]				cce.Contrast = 0.5[=]				cce.Enabled = true[=]				cce.Saturation = 4[=]				cce.TintColor = Color3.new(-9,-1,1)[=]				cce.Parent = L[=]			end)[=]		end,[=]	},[=]	clouds = {[=]		desc = "adds clouds n stuff",[=]		perms = {Commands=true},[=]		func = function(plrWhoTriggered,arguments)[=]			local WS = game:GetService("Workspace")[=]			local L = game:GetService("Lighting")[=]			pcall(function()[=]				local ter = WS:FindFirstChildOfClass("Terrain")[=]				ter:Clear()[=]				ter:ClearAl